function getStackStyle(idx) {
  const size = Math.min(window.innerWidth * 1.1, 480)
  return {
    left: `${size/2}px`,
    top: `${size/2}px`,
    transform: 'scale(1)',
    zIndex: images.length - idx,
    transition: 'all 0.5s cubic-bezier(.68,-0.55,.27,1.55)'
